                props['mapZoom'] = parseInt(params[2]);

                break;
            case paramMap['search']:
                props['search'] = [
                    parseFloat(parseFloat(params[0]).toFixed(6)),
                    parseFloat(parseFloat(params[1]).toFixed(6))
                ];
                break;
